export default function ProjectContent(props: projectContentProps) {
  return (
    <>
      <h2>Top part</h2>
      {props.children}
      <h2>Bottom part</h2>
    </>
  );
}

interface projectContentProps {
  children: React.ReactNode;
  bottomPart: React.ReactNode;
}
